function Home({data}) {
    return (
        <div>
            <h1>Minhas Metas</h1>
            <hr />
            {data.metas.map(meta => (
                <div key = {meta._id} >
                    <h2>{meta.name}</h2>
                    <p>{meta.description}</p>
                    <p>{meta.status}</p>
                    <hr />
                </div>

            ))}


        </div>
    
    )
}

export async function getStaticProps() {
    const response = await fetch(`http://localhost:8080/metas`);
    const data = await response.json();
    //console.log(data);

    return { props: {data}};
  }

export default Home;
